const container = document.getElementById('container');
const isToday = (someDate) => {
    const today = new Date()
    return someDate.getDate() == today.getDate() &&
        someDate.getMonth() == today.getMonth() &&
        someDate.getFullYear() == today.getFullYear()
}
function formatDate(date) {
    var d = new Date(date),
        month = '' + (d.getMonth() + 1),
        day = '' + d.getDate(),
        year = d.getFullYear();

    if (month.length < 2)
        month = '0' + month;
    if (day.length < 2)
        day = '0' + day;

    return [year, month, day].join('-');
}
function RenderHistory() {
    let strHtml = `<tr>
    <th></th>
    <th>Type</th>
    <th>Points earned</th>
    <th>Date</th>
</tr>`
    users.activities.map(
        activity => {
            const activityDate = new Date(activity.dateTime);
            strHtml += `<tr>`
            strHtml += `<td><img src = "${binDict[activity.type].icon}" class="t3-icons" /></td><td><span id="t3-type">${activity.type} </span></td>`
            strHtml += `<td><span id="t3-score">${activity.score} </span></td>`
            strHtml += `<td><span id="t3-date">${formatDate(activity.dateTime)} ${activityDate.getHours()}:${activityDate.getMinutes()} </span></td>`
            strHtml += `</tr>`
        }
    )
    container.innerHTML = strHtml;
}
RenderHistory();
